func TestGetUserInfo(t *testing.T) {
	cli := service.NewUserClient(cookie)
	ctx := context.Background()
	res, err := cli.GetUserInfo(ctx, "xopeachy_keen")
	t.Logf("%v", err)
	t.Logf("%s", log.NewLogString(res))
}

func TestUserExtractor(t *testing.T) {
	extractor := service.NewUserExtractor([]byte(userResp))
	userInfo, err := extractor.ParseUserInfo()
	assert.Nil(t, err)
	t.Logf("%s", log.NewLogString(userInfo))
}

